import React, { Component } from 'react';
import '../ToDo.css';

class ToDo extends Component {
    render() {
        return (
            <div className="ToDo">
                <header className="ToDo-header">
                    <h1>
                        ToDo
                    </h1>
                </header>
            </div>
        );
    }
}

export default App;
